ads.description:
Dzień dobrym, mam do sprzedania samochód osobowy marki Mercedes-Benz E-klasa wyprodukowany w 2009 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 2148 cm3, legitymujący się mocą 136 KM, który pokonał do tej pory 280000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Mercedes prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane.



E-klasa jest wyposażenia w:

- Klimatyzację dwustrefowa ( do przejrzenia);

- Tempomat;

- Skórzana tapicerka;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie i tylne;

- Elektryczne lusterka;

- 4 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 13.11.2025 roku.

Przegląd techniczny 09.12.2025 roku.
